import React from 'react';

const Form=props=>(
    <form onSubmit={props.weatherMethod}>
        <h4>Узнайте погоду в вашем гроде</h4>
        <input type="text" name="city" placeholder="Город"/>
        <button>Получить погоду</button>
    </form>
);

export default Form;
